import React from 'react'
import AddIcon from '@mui/icons-material/Add';

const ModelNode = ({setSelectedNode, type, value, selected, last, key}) => {
    return (
        <div className="model-node" onClick={() => {setSelectedNode(key)}}>
            <div className={selected ? "model-node-selected" : "model-node-unselected"}>
                <p>{type}</p>
            </div>
            <p className="model-node-value">{value}</p>
            {!last ?
                <img src="http://localhost:3000/Node-Connector.png" className="model-node-connector" />
            : (last && type !== "Output") &&
                <AddIcon className="model-node-add" />
            }
        </div>
    )
};

export default ModelNode;
